import React from "react";
import HeadCell from "./HeadCell/index";

const TableHead = ({ matrix }) => {
   const heads = matrix
      .map((item, index) => {
         return <HeadCell key={index} value={"col " + index + 1} />;
      })
      .shift(<HeadCell value={""} />)
      // .push(<HeadCell value={"Sum"} />);

   return (
      <thead>
         <tr>{heads}</tr>
      </thead>
   );
};

export default TableHead;
